import React from 'react';
import '../css/Home.css';

class Home extends React.Component{
  renderPanels(title){
    return(
      <div className="olive column">
        {title}
      </div>
    );
  }

  render(){
    return(
      <div>
        <h2 class="ui center aligned header">
          Concussion Competencies
          <div class="sub header">A framework for school-based concussion management</div>
        </h2>
        <div className="ui stackable three column centered grid">
          <div className="six column centered row">
            {this.renderPanels('hello')}
            {this.renderPanels('hello')}
            {this.renderPanels('hello')}
          </div>
        </div>
      </div>
    );
  };
}

export default Home;
